import { BrowserRouter, Route, Routes } from "react-router-dom";
/*import { TopHeadlines } from "./components/TopHeadlines";*/
import { AllNews } from "./components/AllNews";


function App() {
  return (
    <BrowserRouter>


      <Routes>

        <Route path="/all-news" element={<AllNews/>}></Route>

      </Routes>
    </BrowserRouter>    
  );
}

export default App;
